bool isValid(char* s) {
	SqStack *S=(SqStack*)malloc(sizeof(SqStack));
	InitStack(S);
	ElemType *x=(ElemType*)malloc(sizeof(int));
    while(*s!='\0'){
    	switch(*s){
    		case 40:
    		case 91:
    		case 123:
    			printf("push %d\n",*s);
    			Push(S,*s);
    			break;
    		case 41:
    			Pop(S,x);
    			printf("pop %d\n",*x);
    			if(*x!=40)
    				return false;
    			break;
    		case 93:
    			Pop(S,x);
    			printf("pop %d\n",*x);
    			if(*x!=91)
    				return false;
    			break;
    		case 125:
    			printf("pop %d\n",*x);
    			Pop(S,x);
    			if(*x!=123)
    				return false;
    			break;

    	}
    	s++;
    }
    if(StackEmpty(*S))
    	return true;
    return false;
}

